import React from 'react';
import { Card } from 'react-bootstrap';
import PropTypes from 'prop-types';

function Intern(props) {
    const descriptionItems = props.description;
    const listItems = descriptionItems.map((descriptionItem) =>
        <li key={descriptionItem.id}>{descriptionItem}</li>
    );

    return (
        <div className='intern-section'>
            <Card className="intern-card">
                <h4>{props.internRole}</h4>
                <h5>{props.name}</h5>
                <p className="intern-date"><b>{props.date}</b></p>
                <ul>
                    <li>testing</li>
                </ul>
                <ul>
                    {props.description.map((descriptionItem) =>
        <li key={descriptionItem.id}>{descriptionItem}</li>
    )}
                </ul>
            </Card>
        </div>
    )
}


Intern.propTypes = {
    internRole: PropTypes.string,
    name: PropTypes.string,
    date: PropTypes.string,
    description: PropTypes.string
  };

export default Intern;
